import React, { useState } from 'react';


export const Skills = () => {

    const [languages, setLanguages] = useState([
        {
            id : 0,
            name : 'Java',
            points : [
                'Proficient with object oriented programming in Java.',
                'Built backend applications using Spring Boot framwork, including implenting REST APIs.'
            ]
        }, {
            id : 1,
            name : 'C',
            points : []
        }, {
            id : 2,
            name : 'C++',
            points : []
        }, {
            id : 3,
            name : 'Javascript',
            points : [
                'Built frontend applications using React framework.',
                'Built backend applications using NodeJS and Express frameworks.'
            ]
        }, {
            id : 4,
            name : 'Python',
            points : []
        }, {
            id : 5,
            name : 'SQL',
            points : [
                'Worked with Postgres and SQLite.'
            ]
        }
    ]); 

    const [otherSkills, setOtherSkills] = useState([
        {
            id : 0,
            name : 'English',
            points : [
                'Proficient in reading and writing english.'
            ]
        }, {
            id : 1,
            name : 'Mathematics',
            points : [
                'Strong foundations in calculus, linear algebra, discrete math and statistics.'
            ]
        }
    ]);

    const programmingLanguagesList = languages.map(language => {
                        <li key={language.id} className='language'>
                            {language.name}
                            <ul className='points'>{
                                language.points.map((point, index) => {
                                    <li key={index}>{point}</li>
                                })}</ul>
                        </li>
                    })

    return (
        <div className='skills'>
            <div className='programmingeLanguages'>
                <h2>Programming Languages</h2>
                <ul>{
                    languages.map(language => {
                        <li key={language.id} className='language'>
                            {language.name}
                            <ul className='points'>{
                                language.points.map((point, index) => {
                                    <li key={index}>{point}</li>
                                })}</ul>
                        </li>
                    })
                }</ul>
            </div>
            <div className='otherSkills'>
                <h2>Other Skills</h2>
                <ul>{
                    otherSkills.map(skill => {
                        <li key={skill.id} className='skill'>
                            {skill.name}
                            <ul className='points'>
                                {skill.points.map((point, index) => {
                                    <li key={index}>{point}</li>
                                })}
                            </ul>
                        </li>
                    })
                }</ul>
            </div>
        </div>
    );
}
